package com.chromedata.incentives.extract.dao.model;import java.util.Objects;public class SignatureStackability {    private int id;    private Integer fromSignatureHistoryId;    private Integer toSignatureId;    private RelationType relationType;    private String complexLogic;    public SignatureStackability(Integer id, Integer fromSignatureHistoryId, Integer toSignatureId, RelationType relationType, String complexLogic) {        this.id = id;        this.fromSignatureHistoryId = fromSignatureHistoryId;        this.toSignatureId = toSignatureId;        this.relationType = relationType;        this.complexLogic = complexLogic;    }    public int getId() {        return id;    }    public Integer getFromSignatureHistoryId() {        return fromSignatureHistoryId;    }    public Integer getToSignatureId() {        return toSignatureId;    }    public RelationType getRelationType() {        return relationType;    }    public String getComplexLogic() {        return complexLogic;    }    @Override    public boolean equals(final Object o) {        if (this == o) {            return true;        }        if (!(o instanceof SignatureStackability)) {            return false;        }        final SignatureStackability that = (SignatureStackability) o;        return id == that.id;    }    @Override    public int hashCode() {        return Objects.hash(id);    }}